import React, {Component} from 'react'
import BookImage from '../../asserts/js/images'

export class Blog extends Component {
    constructor(props) {
        super(props)
    }

    render() { 
        return (
            <div className="col-lg border rounded mt-4" style={{marginLeft: '25px', marginRight: '25px'}}>
                <div className="row">
                    <div className="col-7" style={{margin: 'auto 0px'}}>
                        <label className="col-12 mb-0"><b>{this.props.title}</b></label>
                        <p className="mb-0">{this.props.text}</p>
                        <label className="col-12 text-right">by <b>{this.props.userName}</b></label>
                    </div>
                    <div className="col-5" style={{padding: '0px'}}>
                        <img src={BookImage[0]} style={{width: "75%", margin: '20px auto', padding: '0px'}}/>
                    </div>

                </div>
            </div>
        )
    }
}
